import React from "react";
import Navigastion from "./Navigastion/Navigastion";

import styles from "./NavMenu.module.css";
const NAV_MENU = [
  { id: "1", name: "Шашлык" },
  { id: "2", name: "Шаурма" },
  { id: "3", name: "Шаурма" },
  { id: "4", name: "Шаурма" },
  { id: "5", name: "Шаурма" },
  { id: "6", name: "Шаурма" },
  { id: "7", name: "Шаурма" },
  { id: "8", name: "Шаурма" },
  { id: "9", name: "Шаурма" },
  { id: "10", name: "Шаурма" },
  { id: "11", name: "Шаурма" },
];

function NavMenu() {
  const navMenu = NAV_MENU.map((nav) => <Navigastion name={nav.name} />);
  return <div className={styles.container}>{navMenu}</div>;
}

export default NavMenu;
